import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import { FixedSizeList } from 'react-window';
import ChatIcon from '@material-ui/icons/Chat';
import PictureAsPdfRoundedIcon from '@material-ui/icons/PictureAsPdfRounded';
import StarIcon from '@material-ui/icons/Star';
import WorkRoundedIcon from '@material-ui/icons/WorkRounded';
import { Divider } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 300,
    marginLeft: 4,
    backgroundColor: 'gray'
  },
}));

function renderRow(props) {
  const { index, style } = props;

  return (
     <ListItem button style={style} key={index}>
    
      {/* <ListItemText primary={`Item ${index + 1}`}  secondary={"Owner, Country"} />
      <ChatIcon /> */}
      <div style={{height: 70, width: 90,backgroundColor: 'gray',position: 'absolute', left: 0}}>
      <PictureAsPdfRoundedIcon style={{ fontSize: 35, position: 'absolute', left: 25, top: 20}} /> 
      <Divider />
      
      </div>
      <button style={{position: 'absolute', left: 100, width: 90}} className="waves-effect waves-light btn">view</button>
      <ListItemText style={{position: 'absolute', left: 200}} primary={`Item ${index + 1}`}  secondary={"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.  "} />
      <Divider />
      <div style={{marginTop: 20, position: 'absolute', left: 970 }}>
      <StarIcon  />
      <StarIcon  />
      <StarIcon  />
      <StarIcon  />
      <StarIcon  />
      </div>
      <WorkRoundedIcon style={{position: 'absolute', left: 1220, marginTop: 15, color: 'darkgreen'}} />
      {/* <StarIcon style={{marginTop: 20, position: 'absolute', left: 988 }} /v */}
     </ListItem>
    
  );
}

renderRow.propTypes = {
  index: PropTypes.number.isRequired,
  style: PropTypes.object.isRequired,
};

export default function VirtualizedList(props) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
        {/* <h6 style={{backgroundColor: 'gray', textAlign: 'center', height: 40, paddingTop: 10,color: 'white'}}>Currently Present</h6> */}
      <FixedSizeList height={630} width={1290} itemSize={60} itemCount={15} style={{backgroundColor: 'white'}}>
        {renderRow}
      </FixedSizeList>
      <Divider />
    </div>
  );
}
